import * as React from "react";
import "./Matching.css";
import profile from "../../Images/Avatar7.png";
import Navbars from "../Navbar/navbarHome2.js";
import DrawerInHome from "../Drawer/DrawerCustomer";
import {
  FaLanguage,
  FaFile,
  FaLongArrowAltLeft,
  FaLongArrowAltRight,
} from "react-icons/fa";

import {
  IconButton,
  Input,
  Box,
  Autocomplete,
  TextField,
  Stack,
  Rating,
  Modal,
  Typography,
} from "@mui/material";
import { data, data5 } from "../Data/data";
import { useNavigate, useLocation } from "react-router-dom";
import moment from "moment";
import { MdArrowDropDown } from "react-icons/md";

import {
  Translate02EN,
  Translate02DE,
  Translate02TH,
  CustomerEN,
  CustomerDE,
  CustomerTH,
} from "../Data/DataLanguage";

const Matching = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const [languages, setLanguages] = React.useState("");
  const [languages2, setLanguages2] = React.useState("");
  const [page, setPage] = React.useState("Text");
  const [findA_Translator, setFindA_Translator] = React.useState("Translate");
  const [textarea, setTextarea] = React.useState("");
  const [images, setImages] = React.useState([]);
  const [imageURLs, setImageURLs] = React.useState([]);
  const [open, setOpen] = React.useState(false);
  const [trantype, setTranstype] = React.useState("");

  const Doc = location?.state?.name;
  let Toc = location?.state?.languages;

  // const Type = location.state.type
  const Time = moment(new Date()).format("h:mm:ss");
  const Day = moment(new Date()).format("DD MMM YYYY");

  const handleChange = (event) => {
    setTextarea(event.target.value);
  };
  const switchLanguage = () => {
    setLanguages(languages2);
    setLanguages2(languages);
  };

  function onImageChange(e) {
    setImages([...e.target.files]);
  }
  const find_Translator = () => {
    setFindA_Translator("Find_ATranslator");
    // setTranstype("")
    window.scroll(0, 0);
  };

  const Cancle = () => {
    setTranstype("");
    setLanguages("");
    setLanguages2("");
    setTextarea("");
    window.scroll(0, 0);
  };

  // const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  React.useEffect(() => {
    if (images.length < 1) return;
    const newImageUrls = [];
    images.forEach((image) => newImageUrls.push(URL.createObjectURL(image)));
    setImageURLs(newImageUrls);
  }, [images]);

  return (
    <div className="App-body-Order">
      <header className="App-header">
        {Toc === "English" ? (
          <Navbars navigate={navigate} languages="English" />
        ) : Toc === "Thai" ? (
          <Navbars navigate={navigate} languages="Thai" />
        ) : Toc === "German" ? (
          <Navbars navigate={navigate} languages="German" />
        ) : (
          <Navbars navigate={navigate} languages="English" />
        )}
      </header>

      <Box sx={{ display: "flex", width: "100% " }}>
        <DrawerInHome languages={Toc} />

        {Toc === "English" ? (
          <>
            {findA_Translator === "Translate" ? (
              <>
                <div style={{ marginTop: 60, height: 100 }}>
                  <h4
                    style={{
                      fontWeight: 500,
                      fontSize: 26,
                      color: " #034D82",
                      marginLeft: 20,
                      position: "absolute",
                      top: "13%",
                    }}
                  >
                    {Translate02EN[0].label}
                  </h4>
                </div>
                <div className="bodyMatching">
                  <div style={{ margin: 30 }}>
                    {Doc === undefined ? (
                      <>
                        {trantype === "" ? (
                          <Autocomplete
                            id="country-select-demo"
                            sx={{ width: 260 }}
                            options={data5}
                            autoHighlight
                            getOptionLabel={(option) => option.label}
                            onChange={(event, value) =>
                              setTranstype(value.label)
                            }
                            popupIcon={
                              <MdArrowDropDown
                                style={{
                                  color: "#333333",
                                  width: 30,
                                  height: 33,
                                }}
                              />
                            }
                            renderOption={(props, option) => (
                              <Box
                                component="li"
                                sx={{ "& > img": { mr: 2, flexShrink: 0 } }}
                                {...props}
                              >
                                {option.label}
                              </Box>
                            )}
                            renderInput={(params) => (
                              <TextField
                                {...params}
                                label={CustomerEN[9].label}
                                inputProps={{
                                  ...params.inputProps,
                                  autoComplete: "new-password",
                                }}
                              />
                            )}
                          />
                        ) : (
                          <p
                            style={{
                              textAlign: "start",
                              color: "#034D82",
                              fontWeight: 600,
                              fontSize: 24,
                            }}
                          >
                            {trantype}
                          </p>
                        )}
                      </>
                    ) : (
                      <p
                        style={{
                          textAlign: "start",
                          color: "#034D82",
                          fontWeight: 600,
                          fontSize: 24,
                        }}
                      >
                        {Doc}
                      </p>
                    )}

                    {page === "Text" ? (
                      <div>
                        <div style={{ textAlign: "start" }}>
                          <button
                            className="buttonMatching1"
                            onClick={() => setPage("Text")}
                          >
                            <FaLanguage className="iconsMatching" />
                            <p className="textMatching">
                              {Translate02EN[1].label}
                            </p>
                          </button>
                          <button
                            className="buttonMatching"
                            onClick={() => setPage("File")}
                          >
                            <FaFile className="iconsMatching" />
                            <p className="textMatching">
                              {Translate02EN[2].label}
                            </p>
                          </button>
                        </div>
                        <div style={{ float: "left" }}>
                          <p
                            style={{
                              textAlign: "start",
                              color: "#353535",
                              fontSize: 18,
                              marginBottom: 20,
                            }}
                          >
                            {Translate02EN[3].label}
                          </p>
                          <Autocomplete
                            disablePortal
                            id="combo-box-demo"
                            options={data}
                            sx={{ width: 582 }}
                            renderInput={(params) => (
                              <TextField
                                {...params}
                                label={Translate02EN[3].label}
                              />
                            )}
                            isOptionEqualToValue={(option, value) =>
                              option.code === value
                            }
                            value={languages}
                            onChange={(event, value) =>
                              setLanguages(value?.label)
                            }
                          />
                        </div>

                        <button
                          style={{
                            float: "left",
                            width: 30,
                            top: 60,
                            position: "relative",
                            fontSize: 30,
                            marginLeft: 20,
                            marginRight: 20,
                            background: "transparent",
                            border: "none",
                            color: "#262DBB",
                          }}
                          onClick={() => switchLanguage()}
                        >
                          <FaLongArrowAltRight
                            style={{ position: "absolute" }}
                          />

                          <FaLongArrowAltLeft
                            style={{ position: "relative" }}
                          />
                        </button>

                        <div style={{ float: "left" }}>
                          <p
                            style={{
                              textAlign: "start",
                              color: "#353535",
                              fontSize: 18,
                              marginBottom: 20,
                            }}
                          >
                            {Translate02EN[3].label}
                          </p>
                          <Autocomplete
                            disablePortal
                            id="combo-box-demo"
                            options={data}
                            sx={{ width: 582 }}
                            renderInput={(params) => (
                              <TextField
                                {...params}
                                label={Translate02EN[3].label}
                              />
                            )}
                            isOptionEqualToValue={(option, value) =>
                              option.code === value
                            }
                            value={languages2}
                            onChange={(event, value) =>
                              setLanguages2(value?.label)
                            }
                          />
                        </div>

                        <div>
                          <textarea
                            value={textarea}
                            onChange={handleChange}
                            maxLength={350}
                            style={{
                              position: "relative",
                              width: "100%",
                              height: 300,
                              background: "#FFFFFF",
                              border: "1px solid #E5E5E5",
                              boxSizing: "border-box",
                              borderRadius: 5,
                              padding: 20,
                              top: 30,
                              fontSize: 25,
                            }}
                            placeholder={Translate02EN[1].label}
                          />
                        </div>

                        <div style={{ marginTop: 38 }}>
                          <div style={{ float: "left" }}>
                            <button
                              style={{
                                width: 100,
                                height: 40,
                                background: "transparent",
                                color: "#CF0202",
                                border: "1px solid #CF0202",
                                borderRadius: 5,
                              }}
                              onClick={() => Cancle()}
                            >
                              {Translate02EN[4].label}
                            </button>
                          </div>
                          <div style={{ textAlign: "end" }}>
                            <button
                              style={{
                                width: 200,
                                height: 40,
                                background: "#047ACF",
                                color: "#FFFFFF",
                                border: "none",
                                borderRadius: 5,
                              }}
                              onClick={() => find_Translator()}
                            >
                              {Translate02EN[5].label}
                            </button>
                          </div>
                        </div>
                      </div>
                    ) : (
                      <div>
                        <div style={{ textAlign: "start" }}>
                          <button
                            className="buttonMatching"
                            onClick={() => setPage("Text")}
                          >
                            <FaLanguage className="iconsMatching" />
                            <p className="textMatching">
                              {Translate02EN[1].label}
                            </p>
                          </button>
                          <button
                            className="buttonMatching1"
                            onClick={() => setPage("File")}
                          >
                            <FaFile className="iconsMatching" />
                            <p className="textMatching">
                              {Translate02EN[2].label}
                            </p>
                          </button>
                        </div>
                        <div style={{ float: "left" }}>
                          <p
                            style={{
                              textAlign: "start",
                              color: "#353535",
                              fontSize: 18,
                              marginBottom: 20,
                            }}
                          >
                            {Translate02EN[3].label}
                          </p>
                          <Autocomplete
                            disablePortal
                            id="combo-box-demo"
                            options={data}
                            sx={{ width: 582 }}
                            renderInput={(params) => (
                              <TextField
                                {...params}
                                label={Translate02EN[3].label}
                              />
                            )}
                            isOptionEqualToValue={(option, value) =>
                              option.code === value
                            }
                            value={languages}
                            onChange={(event, value) =>
                              setLanguages(value?.label)
                            }
                          />
                        </div>

                        <button
                          style={{
                            float: "left",
                            width: 30,
                            top: 60,
                            position: "relative",
                            fontSize: 30,
                            marginLeft: 20,
                            marginRight: 20,
                            background: "transparent",
                            border: "none",
                            color: "#262DBB",
                          }}
                          onClick={() => switchLanguage()}
                        >
                          <FaLongArrowAltRight
                            style={{ position: "absolute" }}
                          />

                          <FaLongArrowAltLeft
                            style={{ position: "relative" }}
                          />
                        </button>

                        <div style={{ float: "left" }}>
                          <p
                            style={{
                              textAlign: "start",
                              color: "#353535",
                              fontSize: 18,
                              marginBottom: 20,
                            }}
                          >
                            {Translate02EN[3].label}
                          </p>
                          <Autocomplete
                            disablePortal
                            id="combo-box-demo"
                            options={data}
                            sx={{ width: 582 }}
                            renderInput={(params) => (
                              <TextField
                                {...params}
                                label={Translate02EN[3].label}
                              />
                            )}
                            isOptionEqualToValue={(option, value) =>
                              option.code === value
                            }
                            value={languages2}
                            onChange={(event, value) =>
                              setLanguages2(value?.label)
                            }
                          />
                        </div>

                        <div style={{position:""}}>
                          <p
                            style={{
                              fontSize: 25,
                              fontWeight: 800,
                              marginBottom: 20,
                            }}
                          >
                            {Translate02EN[6].label}
                          </p>
                          <p
                            style={{
                              fontSize: 25,
                              fontWeight: 800,
                              marginBottom: 20,
                            }}
